import LoaderPage from "../views/LoaderPage/LoaderPage";
import VendorCreationPage from "../views/VendorCreationPage/VendorCreationPage.jsx";


var indexRoutes = [
  { path: "/create-vendor-account", name: "VendorCreationPage", component: VendorCreationPage },
  { path: "/load-products", name: "LoaderPage", component: LoaderPage },
];

export default indexRoutes;
